    public class RequestHandler : IRequestHandler
    {
        private static IResponseFactory _responseFactory;
        public RequestHandler(IResponseFactory responseFactory)
        {
            _responseFactory = responseFactory;
        }
        public string SendRequest(IRequest request)
        {
            var result = Send(request).Result;
            return result;
        }

        private static async Task<string> Send(IRequest request)
        {
            if (request.GetUrl().Contains("musicbrainz"))
            {
                return GetFakeMusicBrainzResponse();
            }
            using (var client = new HttpClient())
            {
                try
                {
                    client.BaseAddress = new Uri(request.GetUrl());
                    var response = await client.GetAsync(request.GetPath());
                     response.EnsureSuccessStatusCode();
                    return await response.Content.ReadAsStringAsync();
                }
                catch (HttpRequestException e)
                {
                    return _responseFactory.GetErrorResponse();
                }
            }
        }

